// All this because IE is still in use in the wild at 1%
// and doesn't support getting parameters from the query string
function getParameterByName(name, url) {
    if (!url) url = window.location.href;
    name = name.replace(/[\[\]]/g, '\\$&');
    var regex = new RegExp('[?&]' + name + '(=([^&#]*)|&|#|$)'),
        results = regex.exec(url);
    if (!results) return null;
    if (!results[2]) return '';
    return decodeURIComponent(results[2].replace(/\+/g, ' '));
}

this.state.ppt = getParameterByName('PPT') || 0;
this.state.session = getParameterByName('session') || 0;
this.state.stimulusSet = getParameterByName('stimulusSet') || 1;

// Make a predictable pseudorandom number generator based on ppt and session id
var rng = new Math.seedrandom(String(this.state.ppt) + '/' + String(this.state.session));
this.state.orderNum = Math.trunc(rng() * 100);

// Use a specific ordering file based on the randomized orderNum
const binResponse = await fetch(this.files['order' + this.state.orderNum + '.json'])
var binOrder = await binResponse.json()

// The lures get binned by difficulty, so load that for whatever stimulus set we are using
const lureResponse = await fetch(this.files['set' + this.state.stimulusSet + '.json'])
var lureDifficulty = await lureResponse.json()

// Now we need to take that order and randomize stimuli into it,
// pulling evenly from the lure difficulty bins.
// This uses order.js in static files,
// which has separate tests in the git repo!
var filler = new OrderFiller(rng, binOrder, lureDifficulty);
var trials = filler.trialList();
// for debugging
// trials = trials.slice(0, 5);
this.options.templateParameters = trials;

// If it's a foil or a lure, we use whatever "repetition" got set to.
// If it's a repeat, we want to force always showing the "a" stimulus.
var letter = this.parameters.trial_type == 'repeat' ? "a" : this.parameters.repetition;
var url = "https://mstpictures.s3.us-east-2.amazonaws.com/"
var setUrl = url + "set" + this.state.stimulusSet + "/";
this.parameters.image = setUrl + String(this.parameters.stimulus_number).padStart(3, '0') + letter + ".jpg";

if (this.parameters.trial_type == 'repeat' && this.parameters.repetition == 'b') {
  this.parameters.correctResponse = 'old';
} else if (this.parameters.trial_type == 'lure' && this.parameters.repetition == 'b') {
  this.parameters.correctResponse = 'similar';
} else {
  this.parameters.correctResponse = 'new';  
}
